#knippen strings
ch <- NULL
for (i in 1:length(st)){
  ch[i]<-strsplit(st[i],"")
}

#waar !
vecex <- NULL
for (i in 1:length(st)){
  vecex[i] <- list(ch[[i]]=="!")
}

#opsporen ! en volgende char
for (i in 1:length(st)){
  for (j in length(vecex[[i]]):1){
    if(vecex[[i]][j]==TRUE){
      vecex[[i]][j+1] <- TRUE
    }
  }
}

#verwijderen ! en volgende char
for (i in 1:length(st)){
  ch[[i]]<-ch[[i]][!vecex[[i]]]
}

#waar iets anders dan abcd
vecex <- NULL
temp <- NULL
for (i in 1:length(st)){
  for (j in 1:length(ch[[i]])){
    if (sum(ch[[i]][j]==c("a","b","c","d"))){
      temp[j]<-TRUE 
    }
    else {
      temp[j] <- FALSE
    }
  }
  vecex[i] <- list(temp)
  temp <- NULL
}

#verwijderen waar iets anders dan abcd
for (i in 1:length(st)){
  ch[[i]]<-ch[[i]][vecex[[i]]]
}

new<-c(ch[[1]],ch[[2]],ch[[3]],ch[[4]],ch[[5]],ch[[6]])

open <- 0
leftv <- NULL
rightv <- NULL
for (i in 1:length(new)){
  if (open == 0){
    if (new[i]=="c"){
      leftv <- c(leftv,i)
      open <- 1
    }
  }
  else {
    if (new[i]=="d"){
      rightv <- c(rightv,i)
      open <- 0
    }
  }
}

for (i in length(rightv):1){
  new<-new[-(leftv[i]:rightv[i])]
}

curvalue<-0
totvalue<-0
for (i in 1:length(new)){
  if (new[i]=="a"){
    curvalue <- curvalue + 1
    totvalue <- totvalue + curvalue
  }
  else {
    curvalue <- curvalue - 1
  }
}

